define({"topics" : [{"title":"Enable Linkus Service for Users","shortdesc":"\n                  <p class=\"shortdesc\">After setting up the Linkus server, you need to enable Linkus service for extension         users to allow them to log in\n                     Linkus client.\n                  </p>\n               ","id":"task_xkx_s12_2cb","href":"topic\/enable_linkus_services_for_users_2.html","menu": {"hasChildren":false,},"tocID":"task_xkx_s12_2cb-d46e20701","topics":[]},{"title":"Disable Linkus Service for Users","shortdesc":"\n                  <p class=\"shortdesc\">To disallow a user to use Linkus client, you can disable Linkus service for the         user.</p>\n               ","id":"task_zwq_hkm_2fb","href":"topic\/disable_linkus_services_for_users.html","menu": {"hasChildren":false,},"tocID":"task_zwq_hkm_2fb-d46e20774","topics":[]},{"title":"Send Linkus Emails to Users","shortdesc":"\n                  <p class=\"shortdesc\">Linkus server has an email template that contains instructions on how to log in via         QR code and link. You can send\n                     Linkus emails to allow users to log in Linkus clients by         themselves.\n                  </p>\n               ","id":"task_ns5_p22_2cb","href":"topic\/send_linkus_emails_to_users_2.html","menu": {"hasChildren":false,},"tocID":"task_ns5_p22_2cb-d46e20847","topics":[]},{"title":"Edit Linkus Email Template","shortdesc":"\n                  <p class=\"shortdesc\">The PBX has a default Linkus email template. You can edit the template according to         your needs.</p>\n               ","id":"task_pwp_fwm_2fb","href":"topic\/edit_linkus_email_template.html","menu": {"hasChildren":false,},"tocID":"task_pwp_fwm_2fb-d46e20920","topics":[]},{"title":"Linkus Event Settings","shortdesc":"\n                  <p class=\"shortdesc\">To get informed of Linkus events, you can enable notification of Linkus related         events and allow the PBX to record\n                     the Linkus events.\n                  </p>\n               ","id":"topic_a1z_lgn_2fb","href":"topic\/linkus_event_settings.html","menu": {"hasChildren":false,},"tocID":"topic_a1z_lgn_2fb-d46e20993","topics":[]}]});